import axios from 'axios'


export const mainSearch = (keyword) => {
  return function (dispatch) {
    console.log('Hello mainSearch', keyword)
    axios.post('/api/flight/get',
    {
      keyword
    },
    {
      headers: {
        'Content-Type': 'application/json'
      }
    })
    .then((response) => {
      console.log(response.data)
      dispatch({
        type: 'mainSearch',
        payload: response.data
      })
    })
    .catch(function (error) {
      console.log(error);
    });
  }
}

export const getCurrentCity = (lat, lng) => {
  return function (dispatch) {
    console.log('get api', lat + lng)
    axios.post('/api/flight/get',
    { lat, lng },
    { headers: { 'Content-Type': 'application/json' } })
    .then((response) => {
      console.log(response.data)
      dispatch({
        type: 'mainSearch',
        payload: response.data
      })
    })
    .catch(function (error) {
      console.log(error);
    });
  }
}
